import { Button } from '../Button/Button';

interface IProps {
  text: string;
  index: number;
  onDelete: () => void;
  onComplete: () => void;
}
export const ToDoItem = ({ text, index, onDelete, onComplete }: IProps) => {
  return (
    <div style={{ display: 'flex' }}>
      <Button text='&#10004;' onClick={onComplete} />
      <p>{text}</p>
      <Button text='&#10006;' onClick={onDelete} />
    </div>
  );
};
